  \"2015-09-12T07:51:29.984683\",\n\t\"name\": \"notification-and-federal-employee-antidiscrimination-and-retaliation-act-of-2002-no-fear-a\",\n\t\"isopen\":
  true,\n\t\"url\": null,\n\t\"notes\": \"The Notification and Federal Employee Antidiscrimination
  and Retaliation Act of 2002, or No FEAR Act, is intended to reduce the incidence
  of workplace discrimination within the federal government by making agencies and
  departments more accountable. The No Fear Act governs the process of reimbursements
  to the Treasury Department's judgment fund by agencies, from their budgets, for
  judgments against agencies and settlements for discrimination in the workplace.
  The Act requires Federal agencies to be accountable for violations of antidiscrimination
  and whistleblower protection laws, in part by requiring that each Federal agency
  post quarterly on its public Web site, certain statistical data relating to Federal
  sector equal employment opportunity complaints filed with each agency. This data
  asset consists of this quarterly data for the U.S. Office of Personnel Management.
  The reports are organized by fiscal year, or October 1-September 30.\",\n\t\"license_title\":
